// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

struct Option {
    uint256 id;
    string name;
    string description;
    uint256 keyValue;
    int8 finalized;
    uint256 shares;
}


abstract contract TBDv1 {
    /// @notice Defines wether the contract finished fund gathering phase. The strategy to adopt afterwards depends
    ///         on individual implementations
    bool public running = false;

    bool public closed = false;
    bool public cancelled = false;

    address public launcher;
    address public runner;
    address public closer;

    uint256 public launcherShare;
    uint256 public runnerShare;
    uint256 public closerShare;

    string public name;

    IERC20 public token;
    Option[] internal options;
    mapping(uint256 => uint256) internal optionIds;

    constructor(
        string memory _name,
        uint256 _launcherShare,
        uint256 _runnerShare,
        uint256 _closerShare
        ) internal {
        name = _name;
        launcherShare = _launcherShare;
        runnerShare = _runnerShare;
        closerShare = _closerShare;
    }

    function _start() internal {
        running = true;
    }

    function _close() internal {
        closed = true;
    }

    function _cancel() internal {
        cancelled = true;
    }

    ///@return Serialized options
    function getOptions()
        public
        view
        returns (
            uint256[] memory,
            string[] memory,
            string[] memory,
            uint256[] memory,
            int8[] memory,
            uint256[] memory
        )
    {
        uint256 len = options.length;

        uint256[] memory ids = new uint256[](len);
        string[] memory names = new string[](len);
        string[] memory descriptions = new string[](len);
        uint256[] memory keyValues = new uint256[](len);
        int8[] memory finalizations = new int8[](len);
        uint256[] memory shares = new uint256[](len);

        for (uint256 idx = 0; idx < len; ++idx) {
            ids[idx] = options[idx].id;
            names[idx] = options[idx].name;
            descriptions[idx] = options[idx].description;
            keyValues[idx] = options[idx].keyValue;
            finalizations[idx] = options[idx].finalized;
            shares[idx] = options[idx].shares;
        }

        return (ids, names, descriptions, keyValues, finalizations, shares);
    }


    // investment and metadata functions
}
